export const tsVariableToMarkdownString = (tsVariable: TsVariable): string => {
  const titleString = `# ${tsVariable.name} (${
    tsVariable.isExported ? "exported" : "unexported"
  } ${tsVariable.classification})`;

  const alineas: (string | undefined)[] = [titleString, tsVariable.description];

  return alineas.filter(notEmpty).join("\n\n");
};
